import React from 'react';
import s from './FriendsItem.css';

const FriendsItem = (props) => {
    return (
        <li className={s.list__item}>
            <span className={s.ava}></span>
            <span className={s.name}>{props.name}</span>
        </li>
    )
}

export default FriendsItem;
